import React from 'react'
import Card from './Card'

export default function CardList({results}) {
    let data = []
    if(results.data){
        data = results.data.data || [];
    }

    console.log(data)
    return (
        <div className="result">
            {
                data.map((item) => (
                    <Card key={item.id} ingredient = {item}/>
                ))
            }
        </div>
    )   
}
